import React, { useState } from 'react';
import { Box, Columns, Content } from 'react-bulma-components';



function SignUpLogin() {
    return ( 
        <Columns>
            <Columns.Column>
            <Box>Sign Up</Box>
            </Columns.Column>
            <Columns.Column className='is-1'>
                <p>or</p>
            </Columns.Column>
            <Columns.Column>
            <Box>Log In</Box>
            </Columns.Column>
        
        </Columns>
     );
}

export default SignUpLogin;
